import { useNavigate } from "react-router-dom";


const Home = () => {
    const navigate = useNavigate();

    const handleNavigate = (path) => {
        navigate(path);
    };

    return (
        <div >
            <div >
                <h1 >Book Library</h1>
                <div>
                        <button onClick={() => navigate("/dash")}>My Books</button> 
                    </div>
                
            </div>

            <div>
                <div >
                    <div  onClick={() => handleNavigate("/sci-fi")}>
                        


                        <div >Science-fiction</div>
                    </div>
                    <div  onClick={() => handleNavigate("/horror")}>
                        



                        <div >Horror</div>
                    </div>
                </div>
                <div >
                    <div  onClick={() => handleNavigate("/mystery")}>
                        



                        <div >Mystery</div>
                    </div>
                    <div  onClick={() => handleNavigate("/adventure")}>
                        
                        


                        <div >Adventure</div>
                    </div>
                    <div>
                        <button onClick={() => navigate("/genre")}>More Genre</button> 
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Home;
